import React, { PureComponent ,useState } from 'react';
import { Div0,Div1 } from './style.js';
import { Line } from "react-chartjs-2";
import Chart from 'chart.js/auto';
import {data1234} from './a.js'


const request = require('request');
let dataT=[]
const a=[]
const da=[]
const dpart=[]
const label1=[]
request('https://backend-111406.herokuapp.com/api/record/zsda5858sda', function (error, response, body) {
    dataT=JSON.parse(body);
   
});
dataT.map((a)=>(
    da.push(a.num)
))
dataT.map((a)=>(
    label1.push(a.create_time)
))
console.log('a',da);


const DataDraw = () => {
    return (
    <Div0>
        <Div1>
            <Line data={data1234} />
        </Div1>
    </Div0>
    );
}
export default DataDraw;
